export async function Plants() {
    const username = encodeURIComponent('rapaka.chandrashekar@gmail.com');
    const password = encodeURIComponent('chanduR00002@');

    const response = fetch(`https://api-idap.infinite-uptime.com/api/3.0/idap-api/login?username=${username}&password=${password}`, {
        method: 'POST',
        headers: {
            'Accept': 'application/json',
        },
    })
        .then(response => response.json())
        .then(data => {
            // console.log(data)
            if (data.status == "success") {
                const accesstoken = data.accesstoken;
                const response1 = fetch('https://api-idap.infinite-uptime.com/api/3.0/idap-api/plants', {
                    method: 'GET',
                    headers: { "accept": "*/*", "Authorization": "Bearer " + accesstoken }
                }).then(response1 => response1.json()).then(data => {
                    console.log(data);
                })

            }
        })
        .catch(error => {

            console.error(error);
        });


    return await response;
}
